import React from 'react';
import { Link } from 'react-router';

const BoardLinks = () => {
    return (
        <div className="post-links">
            <Link to="/detail/1">1</Link>
            <Link to="/detail/2">2</Link>
            <Link to="/detail/3">3</Link>
            <Link to="/detail/4">4</Link> 
        </div>
    );
};

export default BoardLinks;
